message:
@Aguiar_Costa 

Boa noite! 

Faz bastante execercicio dos glúteos e relaxa bem a sintura, 4 anos de "picanha" para você vai ser dureza...

Ilusões:

1) os militares farão algo (não, não farão; são como os condenados de Nuremberg, só seguem ordens - se houvesse uma lei mandando exterminar as mães, no dia seguinte não haveria uma mãe viva, incluindo as deles);

2) se protestarmos, eles farão algo (também não - em 45 e 64, os EUA eram contra os regimes políticos brasileiros e os próprios militares já pensavam em acabar com aquilo) - os EUA favorecem o comunismo hoje;

3) o poder emana do povo (não emana - o povo é recebido a pau se tentar impor a sua "autoridade"; o poder emana de Deus e em Seu nome deve ser exercido - "nenhum poder sobre Mim terias se do Alto não te fosse concedido", de Nosso Senhor a Pilatos; se temos maus governantes, Deus os permite para nossa punição pelas vidas desregradas e pecaminosas).

#Acordem
